
//base64 to jpg (convient to graphics recognition)

var fs = require('fs');
base64_decode('', 'base64image.jpg');
//base64str is data from server encoding with base64 
function base64_decode(base64str, file) {
    var bitmap = new Buffer(base64str, 'base64');
    fs.writeFileSync(file, bitmap);
}




